import './App.css';

function App() {

  return (
    <div>
   <div className='watch'><span className='time' id='hours'>00</span>:<span className='time' id='mins'>00</span>:<span className='time' id='secs'>00</span>:<span className='time' id='millsecs'>00</span></div>
   <div>
    <button>Start</button>
    <button>Pause</button>
    <button>Lap</button>
    <button>Restart</button>
   </div>
   </div>
  );

}

export default App;
